import React from 'react';
import './gallery.css'; // Import CSS for the gallery layout
import echomain from './images/echomainmenu.png'
import gamewebsite from './images/gamewebsite.png'
import equipmaster from './images/autoequip2.png'
import aerospace from './images/aerospace.png'
import discordbot from './images/discordbot.png'
import vrgame from './images/vrgame8.png'
import bokchoy from './images/unity3.png'
import neon from './images/neonnights.png'
import ecoconnect from './images/mobileapp.png'

// Example image array
const images = [
  { id: 1, src: echomain, title:'Echoes of The Abyss', description: 'test'},
  { id: 2, src: gamewebsite, title: 'Game Website', description: 'test' },
  { id: 3, src: equipmaster, title: 'Equipmaster', description: 'test' },
  { id: 4, src: aerospace, title: 'DOP Map' , description: 'test'},
  { id: 5, src: discordbot, title: 'Discord Bot', description: 'test' },
  { id: 6, src: vrgame, title: 'BuildaPCVR', description: 'test' },
  { id: 7, src: bokchoy, title: 'Bok Choy', description: 'test' },
  { id: 8, src: neon, title: 'Neon Nights', description: 'test' },
  { id: 9, src: ecoconnect, title: 'EcoConnect' , description: 'test'},
];

const Gallery = () => {
  return (
    <div className="gallery-container">
      {images.map((image) => (
        <div key={image.id} className="gallery-item">
          <img src={image.src} alt={image.title} className="gallery-image" />
          <div className="image-title">{image.title}</div>
        </div>
      ))}
    </div>
  );
};

export default Gallery;
